import './NestedMapping.css'


const Users=[
  {
      name:"mh akash",
      age : 30,
      phones :[
          {"home":"019893"},{office:"558885"}
      ]
  },
  {
      name:"ria",
      age : 40,
      phones :[
          {home:"01948593"},{office:"55585885"}
      ]
  },
  {
      name:"kamal",
      age : 50,
      phones :[
          {home:"01989333"},{office:"55386885"}
      ]
  }
]

function NestedMapping() {
  return (
 
    <div className='container'>
          <div className='cards'>
              <div className='card card-one'>
              {Users.map((user)=>{
                const {name,age} = user;
                return(
                  <div>
                      <h2 className="card-title">Name: {name} </h2>
                      <p className="description">Age: {age}</p>
                      {user.phones.map((phone)=>{
                        const {home,office} = phone;
                        return(
                          <div>
                              <p className="description">Home: {home}</p>
                              <p className="">Office: {office}</p>
                        </div>
                        )
                        
                      })}
                  </div>
                )
              })}
                  
              </div>
          </div>
    </div>

         
     

  )
}

export default NestedMapping
